import React from 'react';

function App() {
  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <h1>Hello, Shuda!</h1>
      <p>Welcome to your first React app. ðŸŽ‰</p>
      <button
        onClick={() => alert('Welcome to React!')}
        style={{
          padding: '10px 20px',
          fontSize: '16px',
          color: 'white',
          backgroundColor: 'blue',
          border: 'none',
          borderRadius: '5px',
          cursor: 'pointer',
        }}
      >
        Click Me!
      </button>
    </div>
  );
}

export default App;
